sys_variable_value.value:
(function execute(inputs, outputs) {
    //Variables
    var jsonResponseBody = JSON.parse(inputs.responseBody||'');

    //Guard condition
    if(jsonResponseBody == '') return;

    //Mapping
    outputs.ip = jsonResponseBody.ip;
    outputs.hostname = jsonResponseBody.hostname;
    outputs.city = jsonResponseBody.city;
    outputs.region = jsonResponseBody.region;
    outputs.country = jsonResponseBody.country;
    outputs.location = jsonResponseBody.loc;
    outputs.postal = jsonResponseBody.postal;
    outputs.timezone = jsonResponseBody.timezone;
    outputs.read_me = jsonResponseBody.readme;
    outputs.anycast = jsonResponseBody.anycast;
    outputs.organization = jsonResponseBody.org;

})(inputs, outputs);

